db.patients.aggregate([
    {
        $lookup: {
            from: "encounters",
            let: { patientId: "$PATIENT_ID" },
            pipeline: [
                {
                    $match: {
                        $expr: {
                            $and: [
                                { $eq: ["$PATIENT_REF", "$$patientId"] },
                                { $eq: ["$ORGANIZATION_REF", "5f51c3e2d64468caa5a9d502"] }
                            ]
                        }
                    }
                },
                {
                    $project: {
                        _id: 0,
                        patientId: "$$patientId"
                    }
                }
            ],
            as: "encounterData"
        }
    },
    {
        $match: {
            "encounterData.patientId": {
                $exists: true,
                $ne: []
            }
        }
    },
    {
        $group: {
            _id: null,
            patients: { $push: "$FIRST" }
        }
    },
    {
        $project: {
            _id: 0,
            patients: 1
        }
    }
])

db.patients.aggregate([
  {
    $unwind: {
      path: "$ENCOUNTERS",
      preserveNullAndEmptyArrays: true
    }
  },
  {
    $unwind: {
      path: "$ENCOUNTERS.MEDICATIONS",
      preserveNullAndEmptyArrays: true
    }
  },
  {
    $unwind: {
      path: "$ENCOUNTERS.MEDICATIONS.PAYER_REF",
      preserveNullAndEmptyArrays: true
    }
  },
  {
    $match: {
      "ENCOUNTERS.MEDICATIONS.PAYER_REF": {
        $in: [
          "NO_INSURANCE",
          {
            $exists: false
          }
        ]
      }
    }
  },
  {
    $match: {
      "ENCOUNTERS.MEDICATIONS.PAYER_COVERAGE": {
        $lt: 0
      }
    }
  },
  {
    $group: {
      _id: null,
      count: {
        $sum: 1
      }
    }
  },
  {
    $project: {
      _id: 0,
      numberOfUncoveredMedications: "$count"
    }
  }
])

db.patients.aggregate([
    {
        $match: {
            "ENCOUNTERS.PAYER_REF": {
                $in: [
                    { $ref: "payers.<UUID>" }
                ]
            },
            "ENCOUNTERS.IMMUNIZATIONS": { $exists: true }
        }
    },
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $unwind: "$ENCOUNTERS.IMMUNIZATIONS"
    },
    {
        $match: {
            "ENCOUNTERS.PAYER_REF": {
                $in: [
                    { $ref: "payers.<UUID>" }
                ]
            }
        }
    },
    {
        $group: {
            _id: null,
            uncovered_immunizations: {
                $sum: {
                    $cond: {
                        if: { $eq: ["$ENCOUNTERS.IMMUNIZATIONS.BASE_COST", null] },
                        then: 1,
                        else: 0
                    }
                }
            },
            covered_immunizations: {
                $sum: {
                    $cond: {
                        if: { $ne: ["$ENCOUNTERS.IMMUNIZATIONS.BASE_COST", null] },
                        then: 1,
                        else: 0
                    }
                }
            }
        }
    },
    {
        $project: {
            _id: 0,
            num_uncovered_immunizations: "$uncovered_immunizations",
            num_covered_immunizations: "$covered_immunizations"
        }
    }
])

