db.payers.aggregate([
    {
        $match: {
            NAME: "Medicare"
        }
    },
    {
        $lookup: {
            from: "encounters",
            localField: "_id",
            foreignField: "PAYER_REF",
            as: "encounters"
        }
    },
    {
        $unwind: "$encounters"
