            localField: "encounters._id",
            foreignField: "ENCOUNTER_REF",
            as: "immunizations"
        }
    },
    {
        $unwind: "$immunizations"
    },
    {
        $addFields: {
            payerCoverage: {
                $cond: [
                    { $eq: ["$immunizations.BASE_COST", 0] },
                    0,
                    1
                ]
            }
        }
    },
    {
        $group: {
            _id: null,
            uncoveredImmunizationsCount: {
                $sum: {
                    $cond: {
