                        then: 1,
                        else: 0
                    }
                }
            }
        }
    }
])

db.payers.aggregate([
    {
        $match: {
            PAYER_ID: "d31fccc3-1767-390d-966a-22a5156f4219"
        }
    },
    {
        $lookup: {
            from: "claims",
            let: {payer: "$PAYER_ID"},
            pipeline: [
                {
                    $match: {
                        $expr: {
                            $in: ["$PRIMARY_PATIENT_INSURANCE_REF", "$$payer"]
                        }
                    }
                }, 
                {
                    $unwind: "$CLAIM_TRANSACTIONS"
                }, 
                {
                    $lookup: {
                        from: "patients",
                        localField: "CLAIM_TRANSACTIONS.PROVIDER_REF",
                        foreignField: "PROVIDER_ID",
                        as: "PROVIDER_REF"
                    }
                },
                {
                    $lookup: {
                        from: "procedures",
                        localField: "CLAIM_TRANSACTIONS.PROCEDURE_CODE",
                        foreignField: "CODE",
                        as: "PROCEDURES"
                    }
                },
                {
                    $group: {
                        _id: "$CLAIM_TRANSACTIONS.PROCEDURE_CODE",
                        PROVIDER_REF: {$first: "$PROVIDER_REF"},
                        PROCEDURES: {$first: "$PROCEDURES"}
                    }
                },
                {
                    $unwind: "$PROCEDURES"
                }
            ],
            as: "CLAIM_TRANSACTIONS"
        }
    },
    {
        $group: {
            _id: null,
            COUNT: { $sum: {$cond: [
                {$ne: ['$CLAIM_TRANSACTIONS.PROCEDURE_CODE', null]},
                1,
                0]}}
        }
    },
    {
        $project: {
            _id: 0,
            COVERED_PROCEDURES: "$COUNT"
        }
    }
])

